import { ListaProdutos } from "../componentes/ListaProdutos";


export function RouteApp() {
    return (
        <BrowserRouter>
        <Routes>
        <Route path="/ListaProdutos" element={<ListaProdutos/>} />
        </Routes>
        </BrowserRouter>

    )
}
